--
-- Name: booker_booking_request_count(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION booker_booking_request_count() RETURNS trigger
    LANGUAGE plpgsql
    AS $$

BEGIN

	IF (TG_OP = 'DELETE') THEN

		UPDATE "users" SET "booker_booking_request_count" = (SELECT COUNT(*) as total_count FROM "item_users" WHERE "user_id"= OLD."user_id"  AND (is_booking_request = true AND user_id > 0 AND item_user_status_id = 1)) WHERE "id" = OLD."user_id";

		RETURN OLD;

    ELSIF (TG_OP = 'UPDATE') THEN

		UPDATE "users" SET "booker_booking_request_count" = (SELECT COUNT(*) as total_count FROM "item_users" WHERE "user_id" = OLD."user_id" AND (is_booking_request = true AND user_id > 0 AND item_user_status_id = 1)) WHERE "id" = OLD."user_id";

		RETURN OLD;

		RETURN NEW;

	ELSIF (TG_OP = 'INSERT') THEN

		UPDATE "users" SET "booker_booking_request_count" = (SELECT COUNT(*) as total_count FROM "item_users" WHERE "user_id" = NEW."user_id" AND (is_booking_request = true AND user_id > 0 AND item_user_status_id = 1)) WHERE "id" = NEW."user_id";

		RETURN NEW;

	END IF;

END;

$$;


